"use client"
import React from 'react';
import { useNavigate } from 'react-router-dom';
import { getImageUrl } from '../../utils/imageUtils';

const ChatList = ({ conversations, activeConversation, onSelectConversation }) => {
  const navigate = useNavigate();

  if (!conversations || conversations.length === 0) {
    return (
      <div className="flex flex-col items-center justify-center h-full p-6 text-center bg-white">
        <div className="w-16 h-16 mb-4 rounded-full bg-gray-100 flex items-center justify-center">
          <svg
            xmlns="http://www.w3.org/2000/svg"
            width="24"
            height="24"
            viewBox="0 0 24 24"
            fill="none"
            stroke="currentColor"
            strokeWidth="2"
            strokeLinecap="round"
            strokeLinejoin="round"
            className="text-gray-400"
          >
            <path d="M21 15a2 2 0 0 1-2 2H7l-4 4V5a2 2 0 0 1 2-2h14a2 2 0 0 1 2 2z"></path>
          </svg>
        </div>
        <h3 className="text-lg font-medium text-gray-900 mb-2">No conversations yet</h3>
        <p className="text-sm text-gray-500 max-w-xs">Messages will appear here when you start chatting with someone</p>
      </div>
    );
  }

  const handleSelectConversation = (conversation) => {
    if (onSelectConversation) {
      onSelectConversation(conversation);
    } else {
      navigate(`/messages/${conversation.user.id}`);
    }
  };

  return (
    <div className="h-full overflow-y-auto bg-white divide-y divide-gray-100">
      {conversations.map((conversation) => {
        const isActive = activeConversation === conversation.user.id;

        return (
          <div
            key={conversation.user.id}
            className={`flex items-center p-3 cursor-pointer transition-colors ${
              isActive ? "bg-blue-50" : "hover:bg-gray-50"
            }`}
            onClick={() => handleSelectConversation(conversation)}
          >
            <div className="relative mr-3 flex-shrink-0">
              <img
                src={getImageUrl(conversation.user.image) || "/placeholder.svg"}
                alt={conversation.user.name}
                className="w-12 h-12 rounded-full object-cover"
                onError={(e) => {
                  e.target.onerror = null;
                  e.target.src = "/default-avatar.png";
                }}
              />
              {conversation.user.isOnline && (
                <span className="absolute bottom-0 right-0 w-3 h-3 bg-green-500 rounded-full border-2 border-white"></span>
              )}
            </div>

            <div className="flex-1 min-w-0">
              <div className="flex justify-between items-baseline mb-1">
                <h3 className="text-sm font-medium text-gray-900 truncate">{conversation.user.name}</h3>
                <span className="text-xs text-gray-500 whitespace-nowrap ml-2">
                  {formatMessageTime(conversation.lastMessage.time)}
                </span>
              </div>

              <div className="flex justify-between items-center">
                <p className="text-xs text-gray-500 truncate max-w-[180px]">
                  {conversation.lastMessage.sender === "you" && <span className="font-medium">You: </span>}
                  {conversation.lastMessage.text}
                </p>

                {conversation.unreadCount > 0 && (
                  <span className="ml-2 flex-shrink-0 inline-flex items-center justify-center h-5 min-w-5 px-1.5 rounded-full text-xs font-medium bg-blue-500 text-white">
                    {conversation.unreadCount}
                  </span>
                )}
              </div>
            </div>
          </div>
        );
      })}
    </div>
  );
};

// Helper function to format the message time
function formatMessageTime(timestamp) {
  const date = new Date(timestamp);
  const now = new Date();
  const diffInDays = Math.floor((now - date) / (1000 * 60 * 60 * 24));

  // Today: show time
  if (diffInDays === 0) {
    return date.toLocaleTimeString([], { hour: "2-digit", minute: "2-digit" });
  }

  // Yesterday: show "Yesterday"
  if (diffInDays === 1) {
    return "Yesterday";
  }

  // Within last 7 days: show day name
  if (diffInDays < 7) {
    return date.toLocaleDateString([], { weekday: "short" });
  }

  // Otherwise: show date
  return date.toLocaleDateString([], { month: "short", day: "numeric" });
}

export default ChatList;
